import "./App.css";

function App() {
  return (
    <div
      style={{ backgroundColor: "#1e555c", color: "white", height: "100vh" }}
    >
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h1>25 + 5 Clock</h1>
      </div>
    </div>
  );
}

export default App;
